import * as Styled from './styles'


export const MovieRow = ({  title, items }) =>{

    return(
        <Row>
            <h2>{title}</h2>
            <Styled.ListArea>
                <Styled.List>
                    {items.results.length > 0 && items.results.map((item, key)=>{
                        return (
                            <Styled.Item key={key}>
                                <img src={`https://image.tmdb.org/t/p/w300${item.poster_path}`} alt={item.original_title} />
                            </Styled.Item>
                        )
                    })}
                </Styled.List>
            </Styled.ListArea>
        </Row>
    )
}
